import React, { useState } from 'react';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setIsOpen(open);
  };

  const menuItems = [
    { text: 'About Me', link: '#about' },
    { text: 'Hobbys', link: '#hobbys' },
    { text: 'Work Experience', link: '#work-experience' },
    { text: 'Dev Skills', link: '#dev-skills' },
    { text: 'Contact Me', link: '#contact' }
  ];

  const list = () => (
    <Box
      sx={{ width: 250 }}
      role="presentation"
      onClick={toggleDrawer(false)}
      onKeyDown={toggleDrawer(false)}
    >
      <List>
        {menuItems.map((item) => (
          <ListItem key={item.text} disablePadding>
            <ListItemButton href={item.link}>
              <ListItemText primary={item.text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <nav className="navbar">
      <div className="logo">Nery</div>
      <div className="menu-items">
        {menuItems.map((item) => (
          <a key={item.text} href={item.link}>{item.text}</a>
        ))}
      </div>
      <Button className="menu-icon" onClick={toggleDrawer(true)} aria-label="Toggle navigation">
        <MenuIcon />
      </Button>
      <Drawer
        anchor="right"
        open={isOpen}
        onClose={toggleDrawer(false)}
        PaperProps={{
          sx: {
            backgroundColor: 'rgba(255, 255, 255, 0.95)',
          }
        }}
      >
        {list()}
      </Drawer>
    </nav>
  );
};

export default Navbar;
